class Result extends React.Component {
  constructor(props) {
    super(props)

    this.state = {
      patronous: 
      [
        {stag: [5, 2, 2, 2]},
        {otter: [3, 1, 3, 3]},
        {doe: [2, 2, 2, 2]},
        {phoenix: [3, 4, 1, 3]},
        {wolf: [5, 5, 3, 2]},
        {cat: [5, 2, 5, 5]},
        {horse: [5, 3, 5, 1]}
      ],
      newScore: []
    }
  }

  UNSAFE_componentWillUpdate() {
    let userScore = this.props.userScore
    let newScore = userScore.map((item, index) =>{
