    let convertScore = newScore.map(e => Math.abs(e))
    const reducer = (accumulator, currentValue) => accumulator + currentValue;
    console.log(convertScore.reduce(reducer))
  }

  render() {
    return(
      <h3>{this.props.userScore}</h3>
    )
  }
}

export default Result
